PREFIX ex: <http://example.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?diagnosisName
WHERE {
  ?diagnosis a ex:Diagnosis ;
             rdfs:label ?diagnosisName .
}

PREFIX ex: <http://example.org/>

SELECT DISTINCT ?patient
WHERE {
  ?patient a ex:Patient .
}

