PREFIX ex: <http://example.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?patient ?drug
WHERE {
  ?visit a ex:Visit ;
         ex:hasPatient ?patient ;
         ex:hasDiagnosis ?diagnosis .
    ?diagnosis rdfs:label ?label .
  FILTER (
    CONTAINS(LCASE(?label), "neovascular") &&
    CONTAINS(LCASE(?label), "glaucoma")
  )
}

PREFIX ex: <http://example.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?patient
WHERE {
  ?visit a ex:Visit ;
         ex:hasPatient ?patient ;
         ex:wasGivenDrug ?drug .
  ?drug rdfs:label ?label .
  FILTER (CONTAINS(LCASE(?label), "avastin"))
}

PREFIX ex: <http://example.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?visit
WHERE {
  ?visit a ex:Visit ;
         ex:hasPatient ?patient ;
         ex:hasComplaint ?complaint ;
         ex:hasDiagnosis ?diagnosis .
  ?complaint rdfs:label ?clabel .
  ?diagnosis rdfs:label ?dlabel .
  FILTER (CONTAINS(LCASE(?dlabel), "brvo"))
  FILTER (
    CONTAINS(LCASE(?clabel), "swelling") ||
    CONTAINS(LCASE(?clabel), "redness")
  )
}

PREFIX ex: <http://example.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?patient
WHERE {
  ?visit a ex:Visit ;
         ex:hasPatient ?patient ;
         ex:hasComplaint ?comp ;
         ex:hasDiagnosis ?diag .
  ?comp rdfs:label ?compLabel .
  ?diag rdfs:label ?diagLabel .
  FILTER (CONTAINS(LCASE(?compLabel), "distorted central vision"))
  FILTER (CONTAINS(LCASE(?diagLabel), "cnvm"))
}

PREFIX ex: <http://example.org/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?patient ?age ?iop
WHERE {
  ?visit a ex:Visit ;
         ex:hasPatient ?patient ;
         ex:hasAge ?age ;
         ex:hasIOP ?iop .
  FILTER (xsd:decimal(?age) < 20 && xsd:decimal(?iop) < 15)
}

