PREFIX ex: <http://example.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?visit ?date
WHERE {
  ?visit a ex:Visit ;
         ex:visitDate ?date ;
         ex:hasComplaint ?comp .
  ?comp rdfs:label ?label .
  FILTER (CONTAINS(LCASE(?label), "night"))
  FILTER (STRSTARTS(?date, "2025-07"))  # adjust for current month
}

